sub gb2big5 {
    my($gbtext) = @_;
    my($txtlen) = length($gbtext);
    my($i);
    my($b5text) = "";

    for ($i = 0; $i < $txtlen; $i++) {
	if (vec($gbtext, $i, 8) < 128) {  # ASCII text
	    $b5text .= substr($gbtext, $i, 1);
	} else {		# GB character
	    $gbchar = substr($gbtext, $i, 2);
	    $b5text .= $g2bhash{$gbchar};
	    $i++;
	}
    }
    $b5text;
}


sub big52gb {
    my($b5text) = @_;
    my($txtlen) = length($b5text);
    my($i);
    my($gbtext) = "";

    for ($i = 0; $i < $txtlen; $i++) {
	if (vec($b5text, $i, 8) < 128) {  # ASCII text
	    $gbtext .= substr($b5text, $i, 1);
	} else {		# Big5 character
	    $b5char = substr($b5text, $i, 2);
	    $gbtext .= $b2ghash{$b5char};
	    $i++;
	}
    }
    $gbtext;
}
